  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0150565 includes physical
  and underway data collected aboard the OCEANUS during cruise OC1503B in the North
  Pacific Ocean from 2015-03-10 to 2015-03-14. These data include CURRENT SPEED -
  EAST/WEST COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH COMPONENT (V). The instruments
  used to collect these data include ADCP and GPS. These data were collected by Michael
  Kosro of Oregon State University; College of Earth, Ocean, and Atmospheric Sciences,
  and by Woods Hole Oceanographic Institution as part of Science and Technology Center
  for Coastal Margin Observation and Prediction. The Lamont-Doherty Earth Observatory
  (LDEO) submitted these data to NCEI as part of the NSF sponsored Rolling Deck to
  Repository (R2R) program.nnThe ADCP data represent the raw and automated processed
  data set. Post processed quality assessed data are not available in this accession.\",\n\t\"owner_org\":
